    - ! "<p>\r\n\tUnser Fachpersonal ber&uuml;cksichtigt bei der Entwicklung der optimalen
      Zustellungsroute insbesondere die Abmessungen und die Besonderheit der Fracht,
      Zweckm&auml;&szlig;igkeit, Preis, M&ouml;glichkeit eines maximal effizienten
      Einsatzes diverser Bef&ouml;rderungsarten usw. Ein komplexer und kundenorientierter
      Service erm&ouml;glicht uns den Preis f&uuml;r die Transportdienste wesentlich
      herabzusetzen, und das flexible System der Routeplanung l&auml;sst die Zeit
      sparen.</p>\r\n<p>\r\n\tDie Firma &bdquo;Express logistics&ldquo; bietet Dienstleistungen
      des modalen Verkehrs aller Frachtarten, insbesondere Gro&szlig;raumfracht. Wir
      setzen verschiedene Arten der Transportmittel ein, was uns erm&ouml;glicht,
      die notwendige Fracht in jeden Ort auf der Welt auf dem hohen Qualit&auml;tsniveau
      zu liefern. Unser Fachpersonal besch&auml;ftigt sich mit der pr&auml;zisen Erf&uuml;llung
      aller W&uuml;nsche des Kunden und hilft ihm, eine optimale Route der Frachtzustellung
      sowie notwendige Transportmittel zu w&auml;hlen; dabei garantiert die Firma
      die Unversehrtheit und Sicherheit der Ware. Es ist noch zu erw&auml;hnen, dass
      wir nicht nur die Risiko- und Frachtversicherung anbieten, sondern auch alle
      notwendigen Zollpapiere abfertigen. Beim Bedarf f&uuml;hren wir Belade- und
      Abladearbeiten durch und bieten &Uuml;berladung und Aufstapelung der G&uuml;ter
      an.</p>\r\n<p>\r\n\tMultimodale Bef&ouml;rderungen mit der Firma &bdquo;Express
      logistics&ldquo; bedeutet Qualit&auml;t, Zuverl&auml;ssigkeit und Sicherheit
      Ihrer Waren, unabh&auml;ngig von der Schwierigkeit der Route und Besonderheit
      der G&uuml;ter.</p>\r\n"
    - ! "<p>\r\n\tIn particular, working out the shipment rout our experts consider
      the size and characteristics of cargoes, the practicability, cost and possibility
      of the most efficient usage of various modes of transportation. Both the combined
      and individual approaches to every Client allow making haulage services much
      cheaper, and a flexible rout planning system saves time.</p>\r\n<p>\r\n\tExpress
      Logistics Company renders services of combined transportation of all cargo types
      including bulky ones. We widely use various modes of transport and that guarantees
      qualitative shipment of the cargo to any destination point worldwide. Our experts
      will strictly follow the customer wishes and help him choose the optimum shipment
      rout as well as all necessary transportation modes; therewith the company guarantees
      the commodity entity and safety. It&#39;s worth saying that we not only insure
      risks and underwrite cargoes, but also draw up all necessary customs documents.
      If necessary we perform loading and unloading, and render transshipment and
      palletizing services as well.</p>\r\n<p>\r\n\tThe combined transportation with
      Express Logistics means quality, reliability and safety of Your commodities
      regardless of the rout complexity and specific characteristics of the cargoes.</p>\r\n"
